export const USER_INFO = 'USER_INFO';
export const COIN_INFO = 'COIN_INFO';

export const setUserInfo = (payload) => ({
  type: USER_INFO, payload,
});

export const setCoins = (payload) => ({
  type: COIN_INFO, payload,
});
